import React, { useState } from 'react';
import { saveAs } from 'file-saver';

import styles from './styles/WorkTeamManagement.module.css';


const WorkTeamManagement = () => {
    const teamMembers = [
        { name: "Charles John", email: "charles.j@gmail.com", country: "ID", startDate: "11/12/2023", type: "Contract", position: "UX Researcher", status: "Active" },
        { name: "Dianne Russell", email: "dianne@gmail.com", country: "US", startDate: "10/08/2022", type: "Full-time", position: "UX Designer", status: "Active" },
        { name: "Anette Black", email: "anette@gmail.com", country: "UK", startDate: "10/08/2022", type: "Full-time", position: "Project Manager", status: "Active" },
    ];

    const generateTableHeaders = (data) => {
        if (data.length > 0) {
            return Object.keys(data[0]).map(key => {
                // 将字段名转换为更友好的格式
                const header = key.replace(/([A-Z])/g, ' $1').trim();
                return header.charAt(0).toUpperCase() + header.slice(1);
            });
        }
        return [];
    };

    const [selectedMembers, setSelectedMembers] = useState({});

    const selectAll = () => {
        const newSelection = {};
        teamMembers.forEach(member => {
            newSelection[member.email] = true;
        });
        setSelectedMembers(newSelection);
    };

    const unselectAll = () => {
        setSelectedMembers({});
    };

    const exportSelected = () => {
        const selectedData = teamMembers.filter(member => selectedMembers[member.email]);

        if (selectedData.length > 0) {
            const header = "Name,Email,Country,Start Date,Type,Position,Status\n";
            const csvContent = selectedData.reduce((acc, member) => {
                return acc + `${member.name},${member.email},${member.country},${member.startDate},${member.type},${member.position},${member.status}\n`;
            }, header);

            const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' });
            saveAs(blob, "selected-team-members.csv");
        } else {
            alert("No members selected for export.");
        }
    };

    const invertSelection = () => {
        const newSelection = {};
        teamMembers.forEach(member => {
            newSelection[member.email] = !selectedMembers[member.email];
        });
        setSelectedMembers(newSelection);
    };

    const toggleSelection = (email) => {
        setSelectedMembers(prev => ({
            ...prev,
            [email]: !prev[email]
        }));
    };

    return (
        <div className={styles.container}>
            <h1>NYC Work Team Management</h1>
            <div className={styles.feature}>
                <div>
                    <div>
                        <button onClick={selectAll}>Select All</button>
                        <button onClick={invertSelection}>Select Inverse</button>
                        <button onClick={unselectAll}>Unselect All</button>
                        <button onClick={exportSelected}>Export Selected to CSV</button>
                    </div>
                    <div>
                        <button>Add + </button>
                        <button>Import From CSV</button>
                        <button>Export ALL To CSV</button>
                    </div>
                </div>
                <table className={styles.teamTable}>
                    <thead>
                        <tr>
                            {teamMembers.length > 0 && generateTableHeaders(teamMembers).map((header, index) => (
                                <th key={index}>{header}</th>
                            ))}
                        </tr>
                    </thead>
                    <tbody>
                        {teamMembers.map(member => (
                            <tr key={member.email}
                                className={selectedMembers[member.email] ? styles.selectedRow : ''}
                                onClick={() => toggleSelection(member.email)}>
                                <td onClick={(e) => e.stopPropagation()}>
                                    <input
                                        type='checkBox'
                                        checked={!!selectedMembers[member.email]}
                                        onChange={() => toggleSelection(member.email)}
                                    />
                                </td>
                                <td>{member.name}</td>
                                <td>{member.email}</td>
                                <td>{member.country}</td>
                                <td>{member.startDate}</td>
                                <td>{member.type}</td>
                                <td>{member.position}</td>
                                <td>{member.status}</td>
                                <td>
                                    <button>Edit</button>
                                    <button>Suspend</button>
                                    <button>Delete</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default WorkTeamManagement;
